import React, {Component} from 'react'
import { connect } from 'react-redux';

import getDataUser from  '../../store/actions/getDataUser'
import MainFunctionBar from '../../component/MainFunctionBar/MainFunctionBar'
import classes from './HomePage.module.css'

class HomePage extends Component {
    constructor() {
        super();
        this.state = {
          response: false,
          endpoint: "http://localhost:8000"
        };
    }
    componentWillMount(){
        this.props.getDataUser();
        console.log(this.props.id)
    }

    render() {

        return(
            <div>
            {console.log(this.props)}

                <div>
                    <div className={classes.leftSideBar}>
                        <MainFunctionBar/>
                    </div >
                    {this.props.loading && this.props.id.length !== 0
                    ? "загрузка":
                    <h1 color="#ffffff">Вы вошли как: {"email"} </h1>
                    }   
                </div>
            </div>
        )
    }
}

function mapStateToProps(state) {
    return {
        id: state.getDataUser,
        email: state.getDataUser
    }
}

function mapDispatchToProps(dispatch) {
    return { 
      getDataUser: () => dispatch(getDataUser())
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(HomePage);
